import React from 'react';
import {toDate, formatRelative} from "date-fns";
import "./created.scss"

const Created = ({date:timestamp}) =>{
    let timeZoneOffset = new Date().getTimezoneOffset();
    return (
        <div className="record-createdAt">
            <span>{formatRelative(toDate(timestamp  - (timeZoneOffset * 1000)), new Date())}</span>
        </div>
    )
}


export default Created;
